import { useState, useEffect } from "react";
import './App.css';
import Select from "./components/select";
function App() {
  const [SelectData, setSelectData] = useState([]);
  setSelectData([{
    "deptno": "347",
    "deptname": "資工系"
  }])
  return (
    <div className="App">
      <Select SelectData={SelectData}/>
    </div>
  );
}

export default App;
